import React, { lazy } from 'react';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { StoreContainer } from "./components/Store"
const Dashboard = lazy(() => import("./components/screens/Dashboard"));
const Home = lazy(() => import("./components/screens/Home"));
const Covid = lazy(() => import("./components/screens/Covid"));
const Layout = lazy(() => import("./components/screens/Layout"));
const Forecast = lazy(() => import("./components/screens/Forecast"));
const TableCsvPlaceAlcohol = lazy(() => import("./components/template/TableCsvPlaceAlcohol"));
const TableCsvName = lazy(() => import("./components/template/TableCsvName"));
const ListImages = lazy(() => import("./components/template/ListImages"));

function App() {

  return (
    <Router>
      <StoreContainer.Provider>
        <Layout>
          <Switch>
            <Route exact path={'/'} component={Home} />
            <Route exact path={'/forecast'} component={Forecast} />
            <Route exact path={'/dashboard'} component={Dashboard} />
            <Route exact path={'/place'} component={TableCsvPlaceAlcohol} />
            <Route exact path={'/event'} component={ListImages} />
            <Route exact path={'/name'} component={TableCsvName} />
            <Route exact path={'/covid'} component={Covid} />
            <Route path={'*'} ><NotFound /></Route>
          </Switch>
        </Layout>
      </StoreContainer.Provider>
    </Router >
  );
}
function NotFound() {
  return (
    <h1>Page Not Found</h1>
  )
}

export default App;
